    const {
        register,
        handleSubmit,
        formState: { errors },
        reset,
    } = useForm({
        mode: "onBlur"
  });



  const onSubmit = (data) => {

    fetch('http://localhost:8080/application', {  
      method: 'POST', 
      body: JSON.stringify(data) 
    })
    reset();

    setLoading(true);
    setTimeout(() => {
        setLoading(false);
      }, 5000);


  }


  return (
    <div className='formCard'>
<form onSubmit={handleSubmit(onSubmit)}>


            </form>



    </div>
  )
}

